package listener;

public class URShift {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = -1;
		System.out.println(i >>>= 10);
		long l = -1;
		System.out.println(l >>>= 10);
		short s = -1;
		System.out.println(s >>>= 10);
		byte b = -1;
		System.out.println(b >>>= 10);
		b = -1;
		System.out.println(b >>> 10);

	}

}
